   RTXCTXTPUSHTYPENAME (pctxt, "ProtocolConfigOptions");

   /* decode length */

   RTXCTXTPUSHELEMNAME (pctxt, "length");
   RTDIAG_NEWBITFIELD (pctxt, "INTEGER");

   ret = rtxDecBitsToByte (pctxt, &pvalue->length, 8);
   if (0 != ret) return LOG_RTERR (pctxt, ret);
   endIndex = rtxCtxtGetBitOffset (pctxt) + (pvalue->length) * 8;
   if (!((pvalue->length >= 1 && pvalue->length <= 253))) {
      rtxErrAddElemNameParm (pctxt);
      rtxErrAddIntParm (pctxt, (int)pvalue->length);
      return LOG_RTERR (pctxt, RTERR_CONSVIO);
   }

   ret = rtxCtxtPushContainerBytes(pctxt, pvalue->length);
   if (0 != ret) return LOG_RTERR (pctxt, ret);

   RTDIAG_SETBITFLDCOUNT (pctxt);
   RTXCTXTPOPELEMNAME (pctxt);

   /* decode octet3 */

   RTXCTXTPUSHELEMNAME (pctxt, "octet3");

   RTDIAG_NEWBITFIELD (pctxt, "ext bit");
   ret = rtxDecBit (pctxt, &ext);
   if (ret < 0) return LOG_RTERR (pctxt, ret);
   RTDIAG_SETBITFLDCOUNT (pctxt);

   ret = NASDec_TS24008IE_ProtocolConfigOptions_octet3 (pctxt, &pvalue->octet3
      );
   if (ret < 0) return LOG_RTERR (pctxt, ret);

   RTXCTXTPOPELEMNAME (pctxt);

   /* consume unexpected octets in octet group */
   while (ext == 0)  {
      ret = rtxDecBitsToByte (pctxt, &ext, 8);
      if (ret < 0) return LOG_RTERR (pctxt, ret);
      ext = ext >> 7;
   }

