            return LOG_RTERR (pctxt, RTERR_NOMEM);

         asn1Init_TS24008IE_PCOUnit (pdata);

         RTXCTXTPUSHARRAYELEMNAME (pctxt, "elem", (OSUINT8)tmplist.count);

